import React from "react";
import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <div style={styles.nav}>
      <h3 style={styles.logo}>AI School</h3>

      <div style={styles.links}>
        <Link to="/student">Dashboard</Link>
        <Link to="/doubt">AI Doubt</Link>
        <Link to="/live/class1">Live Class</Link>
        <button onClick={() => {
          localStorage.removeItem("token");
          window.location.href = "/";
        }}>
          Logout
        </button>
      </div>
    </div>
  );
}

const styles = {
  nav: {
    display: "flex",
    justifyContent: "space-between",
    padding: "12px 20px",
    background: "#1e293b",
    color: "white"
  },
  logo: {
    margin: 0
  },
  links: {
    display: "flex",
    gap: "15px",
    alignItems: "center"
  }
};
